px_void PX_Object_PainterBoxOnParamsChanged(PX_Object* pObject, PX_Object_Event e, px_void* ptr)
{
	px_float alpha;
	px_float size;
	px_color clr;
	px_float filter;
	PX_Object_PainterBox* pdesc = PX_ObjectGetDesc(PX_Object_PainterBox, (PX_Object*)ptr);
	PX_Object_PainterBoxOnRenderPresent((PX_Object*)ptr);

	clr = PX_Object_PainterBoxGetToolColor((PX_Object*)ptr);
	size = PX_Object_PainterBoxGetToolSize((PX_Object*)ptr);
	alpha  =PX_Object_PainterBoxGetToolAlpha((PX_Object*)ptr);
	filter=PX_Object_PainterBoxGetToolSmooth((PX_Object*)ptr);

	PX_CanvasVMSetColor(pdesc->pCanvasVM, clr);
	PX_CanvasVMSetSize(pdesc->pCanvasVM, size);
	PX_CanvasVMSetFilter(pdesc->pCanvasVM, filter);

}

px_void PX_Object_PainterBoxFree(PX_Object* pObject)
{
	PX_Object_PainterBox* pdesc = PX_ObjectGetDesc(PX_Object_PainterBox, pObject);
	PX_TextureFree(&pdesc->tex_Eraser);
	PX_TextureFree(&pdesc->tex_Paint);
	PX_TextureFree(&pdesc->tex_Pen);
	PX_TextureFree(&pdesc->tex_Spray);
	PX_TextureFree(&pdesc->tex_Hand);
	PX_TextureFree(&pdesc->tex_back);
	PX_TextureFree(&pdesc->tex_forward);
	PX_TextureFree(&pdesc->tex_viewreset);

	PX_TextureFree(&pdesc->present);
}

